import React,{Component} from 'react';
// import TrackerReact from 'meteor/ultimatejs:tracker-react';
import { render } from 'react-dom';
import { BrowserRouter, Route, Switch,Link,location } from 'react-router-dom';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.min.css';
import $ from "jquery";
import Header from '../header/Header.js'
// import ViewPage_1 from '../../../component/createnewpage/viewpage_1.js';
// import ViewBlock_1 from '../../../component/createnewblock/viewblock1.js';
import './Leftsidebar.css';

export default class Leftsidebar extends Component{

  constructor(props) {
   super(props);
    this.state = {}
  }

  componentDidMount(){
             //     $(document).ready(function () {
             //     $('#sidebarCollapse').on('click', function () {
             //         $('#sidebar').toggleClass('active');
             //     });
             // });
  }  

  eventclk(event){
    event.preventDefault();
    $(event.currentTarget).addClass('active');
    $(event.currentTarget).siblings('li').removeClass('active');
    // $(event.currentTarget).siblings('li').children('.treeview-menu').toggle();

  }

  eventclk1(event){
    event.preventDefault();
    $(event.currentTarget).children('.treeview-menu').toggle();
    $(event.currentTarget).addClass('active');
    $(event.currentTarget).siblings('li').removeClass('active');
    // $(event.currentTarget).siblings('li').children('.treeview-menu').toggle();

  }  

  clickLiTree(event){
    event.preventDefault();
    $(event.target).parent().addClass('activeLi');
    var checkli = $(event.target).parent().siblings('li').removeClass('activeLi');
  }

  clickTree(event){
      event.preventDefault();
      console.log('$(event.currentTarget)',$(event.currentTarget));
      $(event.currentTarget).addClass('activetree');
      $(event.currentTarget).siblings('li').removeClass('activetree');
      $(event.currentTarget).siblings('li').removeClass('menu-open');
      $(event.currentTarget).siblings('li').children('.treeview-menu').css('display','none');
      $(event.currentTarget).siblings('li').children('.treeview-menu').children().removeClass('activeLi');
  }  


  render(){
    var sidebarHeight = window.screen.height - 180;
    return(
   <div>
        <aside className="leftsidebar">
          <div className="wrapper">
            <nav id="sidebar">
              <div className="sidebar-header">
                <img className="headerImage col-lg-4 col-lg-offset-4" src="/images/iAssureIT_favicon_white.png"/>
                <img className="sidebarLogoName strong" src="/images/iAssureIT_favicon_blue.png"/>
              </div>
              <ul className="list-unstyled components scrollBox" style={{height:  sidebarHeight+"px"}}>
                <li className=" sidebarMenuText">
                  <a href="/dashboard" title="Dashboard">
                    <i className="glyphicon glyphicon-briefcase"></i>
                    <span className="iconTitle">Dashboard</span>
                  </a>
                </li>
                <li className="sidebarMenuText" onClick={this.eventclk1.bind(this)}>
                  <a href="#Client" data-toggle="collapse" aria-expanded="false" className="menuContent" title="Client Management">
                    <i className="fa fa-user" />
                    <span className="iconTitle">Client Management</span>
                    <i className="leftarrow fa fa-sort-down rotate pull-right"></i>
                  </a>
                  <ul className="collapse   list-unstyled activeClass" id="Client">

                    <li>
                      <a href="/client/basic-details" title="Add Client">
                        <i className="fa fa-circle-o" />

                        <span className="sidebarMenuSubText">Add Client</span>
                      </a>
                    </li>
                    <li>
